randomgen<-function(n,t1){
  #op <- options(digits.secs=6)
  #t1<-Sys.time()
  offset1<-as.numeric(substr(t1,21,22))
  offset2<-as.numeric(substr(t1,16,16))*10+as.numeric(substr(t1,19,19))+1
  x<-as.numeric(substr(t1,23,24))+1
  y<-as.numeric(substr(t1,25,26))
  t1;offset1;offset2;x;y

  x<-ifelse(!is.na(x),x,101)
  y<-ifelse(!is.na(y),y,100)
  offset1<-ifelse(!is.na(offset1),offset1+1,101)
  t1;offset1;offset2;x;y
  
  resultVector<-NULL

  for (i in 1:n ) {
      
  resultVector[i]<-ifelse(piV[x,y]<5,-1,1)
    
  x<-x+offset1
  if(x>103) x<-x-103

  y<-y+offset2
  if(y>101) y<-y-101

  }
  return(resultVector)
}

